import React, { Component } from "react";
import VideoItem from "../videoItem/videoItem";

const items = [
  {
    title: "How to prepare a great beer",
    type: "video",
    source: "facebook",
    videoId: "1052114818157758",
    views: 4569654
  },
  {
    type: "video",
    source: "url",
    url: "http://cdn.playbuzz.com/content/feed/video-1.mp4",
    views: 8820
  },
  {
    title: "Be a winner!",
    type: "video",
    source: "youtube",
    views: 12451409
  },
  {
    title: "Top 10 fastest cars in the world",
    type: "video",
    source: "youtube",
    videoId: "h8MbhS5XKow",
    views: 25560867
  },
  {
    title: "A funny dog barking",
    type: "video",
    source: "youtube",
    videoId: "MveqXxB12YA",
    views: 4287171
  }
];

let expextedKeys = ["title", "views", "videoId"];
let urlExtensions = {
  facebook: "https://www.facebook.com/facebook/videos/",
  youtube: "https://www.youtube.com/embed/",
  itemNotFound:
    "https://cdn.dribbble.com/users/447357/screenshots/2816714/404-800.gif"
};

class VideoList extends Component {
  state = {};
  render() {
    return (
      <div>
        {this.mapArray().map(item => (
          <VideoItem info={item} />
        ))}
      </div>
    );
  }

  mapArray() {
    this.items.map(function(value, index) {
      if (!this.checkItemKeys(value.keys())) {
        return {
          url: this.urlExtensions["itemNotFound"]
        };
      }

      return { url: this.urlExtensions[value.source] };
    });
  }

  checkItemKeys(itemKeys) {
    return itemKeys.includes(this.expextedKeys);
  }
}

export default VideoList;
